import React from 'react';
import StepsPanel from './StepsPanel';

const TNC = () => {
    return (
        <div className="container c-row no-padding tnc no-wrap">
      <StepsPanel />
      <div className='container'>
      <h2 className="heading-normal">Terms & Conditions</h2>
      </div>
      </div>
    );
};

export default TNC;
